import React, { useRef, useState } from "react";
// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Menu from '../pages/Menu';
import { Link } from "react-router-dom";
import Button from 'react-bootstrap/Button';
import ButtonGroup from 'react-bootstrap/ButtonGroup';

// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";


import "./styles.css";

// import required modules
import { Autoplay, Pagination, Navigation } from "swiper";
import { Hidden } from "@mui/material";
import ReactLogo from '/Users/san/Downloads/my-app/src/what.svg';
export default function App() {
  return (


    <>
    <div className="App z-" >
      <img src={ReactLogo} alt="React Logo" />
    </div>
      <Swiper style={{
        height: "50vh",
        marginTop: "50px",
        marginBottom: "50px",
      }}
        spaceBetween={30}
        centeredSlides={true}
        autoplay={{
          delay: 2500,
          disableOnInteraction: false,
        }}
        pagination={{
          clickable: false,
        }}
        navigation={false}
        modules={[Autoplay, Pagination, Navigation]}
        className="mySwiper"
      >
        <SwiperSlide>Slide 1</SwiperSlide>
        <SwiperSlide>Slide 2</SwiperSlide>
        <SwiperSlide>Slide 3</SwiperSlide>
        <SwiperSlide>Slide 4</SwiperSlide>
        <SwiperSlide>Slide 5</SwiperSlide>
        <SwiperSlide>Slide 6</SwiperSlide>
        <SwiperSlide>Slide 7</SwiperSlide>
        <SwiperSlide>Slide 8</SwiperSlide>
        <SwiperSlide>Slide 9</SwiperSlide>
      </Swiper>

      <div style={
          {
            backgroundImage: 'url("https://images.unsplash.com/photo-1617672700003-8b8b5b5b5b1c?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1050&q=80")',
            backgroundSize: 'cover',
            backgroundPosition: 'center',
            backgroundRepeat: 'no-repeat',
            width: '100%',
            height: '100%',
            position: 'absolute',
            top: 0,
            left: 0,
            zIndex: -1,
          }
      }>
<div>
<Link to='/menu'  >
{/* center text */}
<div style={{

  textAlign: 'center',
  fontSize: '20px',
  fontWeight: 'bold',
  color: 'white',
  marginTop: '50px',
  marginBottom: '50px',
  border: '1px solid black',
  borderRadius: '10px',
  marginLeft: '600px',
  marginRight: '600px',

}}>
  Menu
</div>
</Link>
</div>
      </div>
    </>
  );
}
